package basicimport java.io.BufferedReaderimport java.io.InputStreamReaderimport kotlin.math.sqrtfun main() {    val br = BufferedReader(InputStreamReader(System.`in`))    var num = br.readLine().toInt()    if (num == 1) {        return    }    val s = sqrt(num.toDouble()).toInt()    var ans = emptyArray<Int>()    for (i in 2..s) {        while (num % i == 0) {            num /= i            ans += i        }    }    if (num > 1) { ans += num }    ans.forEach { println(it) }}